import React from 'react';
import {NavLink} from 'react-router-dom';
import homeimg from '../Images/homeimg.png';
import '../Css/HomeAbout.css';
import Same from './Same';

const Home=()=>{
    return(
        <>
        <Same
        title="Learning made easy"
        text="Bimbel EduMan merupakan lembaga bimbingan belajar terbaik persiapan test CPNS. Berdiri sejak 2 Mei 2019 di Kota Bandung, 
        saat ini Ganesha Operation telah tersebar di 265 kota di Indonesia, Mulai dari Aceh hingga Ambon." 
        imgsrc={homeimg}
        btn="Coba Modul"
        />
        </>
    )
}
export default Home;
